<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Transaction Streak Analyzer</title>
  <style>
    /* ----- Global Styles ----- */
    body {
      font-family: Arial, sans-serif;
      max-width: 800px;
      margin: 2rem auto;
      padding: 1rem;
      background: linear-gradient(135deg, #e2e8f0, #f4f4f4);
      color: #333;
      line-height: 1.6;
    }
    h1, h2, h3 {
      text-align: center;
      margin-bottom: 0.5rem;
    }
    p {
      text-align: center;
    }
    form {
      margin: 1rem 0;
      text-align: center;
    }
    input, button {
      padding: 0.5rem 0.75rem;
      margin: 0.5rem;
      font-size: 1rem;
      border: 1px solid #ccc;
      border-radius: 4px;
    }
    button {
      cursor: pointer;
      background-color: #3498db;
      color: #fff;
      border: none;
    }
    button:hover {
      background-color: #2980b9;
    }
    
    /* ----- Container Styles ----- */
    #status-container {
      text-align: center;
      font-weight: bold;
      margin: 1rem 0;
      min-height: 2em;
    }
    #results, #log {
      background: #fff;
      border: 1px solid #ddd;
      padding: 1rem;
      margin-top: 1rem;
      border-radius: 5px;
      box-shadow: 0 2px 5px rgba(0,0,0,0.1);
    }
    #results h2, #results h3 {
      margin-top: 0;
    }
    /* Limit the height of the log and style it slightly smaller */
    #log {
      white-space: pre-wrap;
      overflow: auto;
      max-height: 200px;
      font-size: 0.9rem;
      display: none; /* Hidden by default */
    }
    /* Style for the toggle log button */
    #toggle-log-btn {
      display: block;
      margin: 0.5rem auto;
      background-color: #2ecc71;
    }
    #toggle-log-btn:hover {
      background-color: #27ae60;
    }
    /* Style for the preformatted block */
    pre {
      background: #f9f9f9;
      padding: 1rem;
      border-radius: 4px;
      overflow-x: auto;
    }
    
    /* ----- Spinner Styles ----- */
    #spinner {
      border: 4px solid #f3f3f3;
      border-top: 4px solid #3498db;
      border-radius: 50%;
      width: 20px;
      height: 20px;
      animation: spin 1s linear infinite;
      display: inline-block;
      vertical-align: middle;
      margin-left: 10px;
    }
    @keyframes spin {
      0% { transform: rotate(0deg); }
      100% { transform: rotate(360deg); }
    }
  </style>
</head>
<body>
  <h1>Transaction Streak Analyzer</h1>
  <p>Enter a blockchain address and a start date to analyze your transaction streaks.</p>
  
  <form id="analyzer-form">
    <input type="text" id="address" placeholder="Enter address" required>
    <!-- Default date set to November 21, 2024 -->
    <input type="date" id="start-date" required value="2024-11-21">
    <button type="submit">Analyze</button>
  </form>
  
  <div id="status-container">
    <span id="status"></span>
  </div>
  
  <button id="toggle-log-btn" onclick="toggleLog()">Show Log Details</button>
  <div id="log"></div>
  
  <div id="results"></div>
